import React from 'react';
import ReactDOM from 'react-dom';

// Components
import App from './App';

// Styles
import './styles/Index.scss';

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
